# 1:1 binding
def system01_one_to_one__p_l_kd__pl(p, l, kdpl):
    p = mpf(p)
    l = mpf(l)
    kdpl = mpf(kdpl)
    return ((p+kdpl+l-sqrt(-4*p*l+power(p+kdpl+l, 2)))/2.).real

